import logo from "./logo.svg";
import "./App.css";
import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
} from "react-router-dom";

function App() {
  const router = createBrowserRouter([]);
  return (
    <div>
      <RouterProvider router={router} />
    </div>
  );
}

export default App;
